import React, { Component } from 'react'

export default class Cube extends Component {
    render() {
        return (
            <div id="wrapD3Cube">
                <div id="D3Cube"
                    onMouseEnter={Animation='none'}
                >
                    <div id="side1"></div>
                    <div id="side2"></div>
                    <div id="side3"></div>
                    <div id="side4"></div>
                    <div id="side5"></div>
                    <div id="side6"></div>
                </div>
            </div>
        )
    }
}
